import styled from "styled-components";


export const HeaderWrapper = styled.div`
  color: #222;
  
  .title {
    font-size: 22px;
    font-weight: 700;
    margin-bottom: 16px;
  }

  .subtitle {
    font-size: 16px;
    margin-bottom: 20px;
  }
`
